import React from 'react';
import './Header2.css';
function Header2() {
    return (
        <div className="header2">
            <div className="header2__address">
                <img
                    className="header2__addressLogo"
                    src=""
                    alt="header2__locationImage"
                />
                <h4>Hello</h4>
                <h2>Select Your address</h2>
            </div>
        </div>
    )
}

export default Header2
